AjaxControlToolkit.AutoCompleteBehavior.prototype._onListMouseDown =
function (ev) { ///
 /// Handler for the mousedown event on the autocomplete
	flyout. /// 
///

///

if (ev.target !== this._completionListElement) { if
(this._selectIndex === -1) { var children =
this._completionListElement.childNodes; //alert(children.length);
var parent = ev.target.parentElement; //alert(parent.innerHTML); //
make sure the selected index is updated for (var i = 0; i <
children.length; ++i) { if (parent === children[i]) {
this._highlightItem(parent); this._selectIndex = i; break; } } }
//alert(this._selectIndex ); this._setText(ev.target);
this._flyoutHasFocus = false; } else { // focus is still on the
flyout and we do not want to hide it this._flyoutHasFocus = true; }
};
AjaxControlToolkit.AutoCompleteBehavior.prototype._onListMouseOver =
function (ev) { ///
 /// Handler for the mouseover event on the autocomplete
	flyout. /// 
///

///

var item = ev.target; if (item !== this._completionListElement) {
var children = this._completionListElement.childNodes; var parent =
ev.target.parentElement; // make sure the selected index is updated
for (var i = 0; i < children.length; ++i) { if (item ===
children[i]) { this._highlightItem(item); this._selectIndex = i;
break; } else if (parent === children[i]) {
this._highlightItem(parent); this._selectIndex = i; break; } } } };
AjaxControlToolkit.AutoCompleteBehavior.prototype._setText =
function (item) { //Rewrite the _setText function to insert the
newText into the ListBox. var text = (item && item.firstChild) ?
item.firstChild.nodeValue : null; this._timer.set_enabled(false);
var element = this.get_element(); var control = element.control; var
tgControl = item.nodeName; var newText =
this._showOnlyCurrentWordInCompletionListItem ?
this._getTextWithInsertedWord(text) : text; if (newText !== "E-Mail"
&& newText !== "Chat" && tgControl !== "IMG" && tgControl !== "A") {
if (control && control.set_text) { control.set_text(newText); } else
{ element.value = newText; } } $common.tryFireEvent(element,
"change"); if (newText !== "E-Mail" && newText !== "Chat" &&
tgControl !== "IMG" && tgControl !== "A") {
this.raiseItemSelected(new
AjaxControlToolkit.AutoCompleteItemEventArgs(item, text, item ?
item._value : null)); } this._currentPrefix =
this._currentCompletionWord(); if (newText !== "E-Mail" && newText
!== "Chat" && tgControl !== "IMG" && tgControl !== "A") {
this._hideCompletionList(); } };

